import React from 'react';
import {Link,BrowserRouter} from 'react-router-dom';

export default class NavLink extends React.Component {
    render(){
        return(
            <div className="nav">
                <ul>
                    <li></li>
                    <li><Link to="/about">About</Link></li>
                    <li>Message</li>
                </ul>
            </div>
        )
    }
}
